import React,{Component} from 'react';

class CardHeader extends Component{
    render(){
        return(
            <div className="card-header">
                <div className="auth-profile">
                  profile icon
                </div>
                <div className="auth-name-time">
                   <span>Sikandar</span>
                   <span>time</span>
                </div>
            </div>
        )
    }
}

export default CardHeader;
